B.DP=new A.dg("Device Information","We collect information from your device in some cases. The information will be utilized for the provision of better service and to prevent fraudulent acts. Additionally, such information will not include details that would identify the individual user.")
B.DL=new A.dg("Service Providers","We may employ third-party companies and individuals for the following reasons:\n\n- To facilitate our Service\n- To provide the Service on our behalf\n- To perform Service-related services\n- To assist us in analyzing how our Service is used\n\nThese third parties may have access to your Personal Information to perform their assigned tasks on our behalf. However, they are obligated not to disclose or use the information for any other purpose.")
B.DJ=new A.dg("Security","We value your trust in providing us with your Personal Information, and we strive to use commercially acceptable means of protecting it. However, no method of transmission over the Internet or electronic storage is 100% secure and reliable, and we cannot guarantee its absolute security.")
B.DI=new A.dg("Children\u2019s Privacy","This Service does not address anyone under the age of 13. We do not knowingly collect personally identifiable information from children under 13. If we discover that a child under 13 has provided us with personal information, we will immediately delete this from our servers.\n\nIf you are a parent or guardian and are aware that your child has provided us with personal information, please contact us so that we can take the necessary actions.")
B.DN=new A.dg("Changes to This Privacy Policy","We may update our Privacy Policy from time to time. You are advised to review this page periodically for any changes. We will notify you of any updates by posting the new Privacy Policy on this page. These changes are effective immediately after they are posted.")
